{'reviewer': {'displayName': 'E L'}, 'starRating': 'THREE', 'comment': '(Translated by Google) I went to the campsite to stay from Saturday to Sunday, I arrived at 3:30 pm and they wanted to charge me 2 days... I was really upset, since I go on almost all holidays. When we decided to leave, the girl at the reception wanted to let us in (after being in that climate/stress) we left, and we got to know a much better camping site than theirs. That is, I always went there, now I have a better option. I think that the campsites in the region should improve the check-in time, because for those who go camping, the time makes a difference (you need to set up tents, see the location... and the camping lighting is not efficient) it is very different than staying in a chalet ... and from what I saw, everyone has the same problem! The campground that allowed me to enter earlier was at the exception level! Another thing... the price of breakfast is very abusive!!

(Original)
